import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [s3Contents, setS3Contents] = useState([]);
  const [predictions, setPredictions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const API_URL = 'http://localhost:5000';

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      setLoading(true);
      setError(null);

      // Test server connection first
      const response = await fetch(`${API_URL}/api/s3-contents`, {
        method: 'GET',
        headers: {
          'Accept': 'application/json',
          'Content-Type': 'application/json',
        },
      });

      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.error || 'Failed to fetch data');
      }

      const data = await response.json();
      setS3Contents(data);

    } catch (error) {
      console.error('Fetch error:', error);
      setError(error.message || 'Failed to fetch data');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Cloud Project Dashboard</h1>
        {error && (
          <div className="error-banner">
            {error}
            <button onClick={fetchData}>Retry</button>
          </div>
        )}
      </header>

      <main>
        {loading ? (
          <div className="loading">Loading...</div>
        ) : (
          <div className="dashboard">
            <section className="s3-section">
              <h2>S3 Bucket Contents</h2>
              {s3Contents.length === 0 ? (
                <p>No files found in bucket</p>
              ) : (
                <ul>
                  {s3Contents.map((item, index) => (
                    <li key={index}>{item.Key}</li>
                  ))}
                </ul>
              )}
            </section>
          </div>
        )}
      </main>
    </div>
  );
}

export default App;
